import React from 'react';
import { Link } from 'react-router-dom';

class Browse extends React.Component {
  render() {
    return (
      <div class="browse">
        <Link to="/">Home</Link>
        <span> | </span>
        <Link to="/about">About</Link>
        <span> | </span>
        <Link to="/projects">Projects</Link>
        <span> | </span>
        <Link to="/contact">Contact</Link>
      </div>
    )
  }
}

export default Browse;
